import React from 'react'

class Search extends React.Component {
    state = { title: "" }
    render() {
        return (
            <div>
                <div class="search">
                    <label for="search-bar">Search :</label>
                    <input value='this.state.title' type='text' name='search-bar' placeholder='Search your query here' onSubmit={this.onSubmit}></input>
                </div>
            </div>
        )
    }

}

export default Search
